Review:
딱 가격만큼 신었을때 핏은 너무너무 예뻐요~ 발도 그렇게 불편하진 않는데... 문제는.. .
스텔레토라 굽 흔들림 있구요~ 2번신었는데 굽이 떨어져 나갔네요 .. 
수선해야하는데 수선할 시간이 없어서 결국 신지 못하고있다는 ㅎㅎ;;

신고 다녀봤더니 너무 딱딱.. 바닥에 쿠션감도 없고, 
발등 가죽도 딱딱해서 아파용;;
신고다니다보면 괜찮아질지 모르겠으나 
일단 당장 아파서 자주 안신게 될것 같습니당;

아쉽네요   레이스 대칭이 안맞아요;
 입으면 차이가 더 심해 보여요
 교환하기 번거로워서 안할려구요;
 저렴한데 배송비까지 없어서 구매했는데
 조금 아쉽네요.. 옷 자체는 짱짱하고 괜찮은데
 조금 더 검수해주셔서 보내주시면 좋을것같네요.
